import React from 'react';

const Example = () => {
  return (
    <>
      <div style={{ color:"white", display: 'flex', justifyContent: 'space-between', flexWrap: 'wrap' }}>
        <div style={{ width: '40%', flexGrow: 1 }}>
          <img style={{ borderRadius: '20%', marginLeft:'50px', width: '100%' }} src='https://tinyurl.com/vhj5skyz' alt='Fitness' />
        </div>
        <div style={{ width: '50%', textAlign: 'center', marginTop: '70px', marginRight: '50px' }}>
          <h1>HELLO</h1>
          <p style={{ textAlign: 'center' }}>
            It’s One-on-Wonderful. Here at Crunch, we focus on bringing you the most powerful workouts to meet your needs: our toolbox includes weighted battle ropes, kettlebells, TRX® suspension straps, MMA equipment, Bulgarian Bags, and the list goes on.

            It may sound like a mouthful, but this world-class functional training equipment helps our trainers provide you with an array of High Intensity Interval Training (HIIT) workouts.

            Our Crunch Fitness locations offer HIITZone, an all-encompassing fitness program including personal training, small group training, and nutrition.

            Let’s make a lunge date!
          </p>
        </div>
      </div>
    </>
  );
};

export default Example;
